    modifier onlyAuctionExists(string _auctionid){
        // check if auction exists
        require(AuctionsMap[_auctionid].exists, "AuctionId does not exists!");
        _;
    }

    modifier onlyStartedAuction(string _auctionid){
        // check if auction should be active  
        require(AuctionsMap[_auctionid].status == AuctionLib.Status.STARTED, "Auction is not started!");
        _;
    }

    modifier onlyNotCancelledAuction(string _auctionid){
        // check if auction should be isCancelled  
        require(AuctionsMap[_auctionid].status != AuctionLib.Status.CANCELLED, "Auction is cancelled!");
        _;
    }

    modifier onlyNotBiddedAuction(string _auctionid){
        //check if already bidder alreay bidded?
        require(!AuctionsMap[_auctionid].alreadyBidded[msg.sender], "Already bidded for this auction!");
        _;
    }

    modifier onlyAfterStartAuction(string _auctionid){
        // should be allowed after Auction startBlock
        require(block.number > AuctionsMap[_auctionid].startBlock,"Auction has not been started!");
        _;
    }

    modifier onlyBeforeEndAuction(string _auctionid){
        // should be allowed before auction endBlock
        require(block.number < AuctionsMap[_auctionid].endBlock,"Auction is finished!");
        _;
    }

    modifier onlyAfterEndAuction(string _auctionid){
        require(block.number > AuctionsMap[_auctionid].endBlock, "Auction is still going on!");
        _;
    }
    modifier onlyOwner(string _auctionid){
        require(users[msg.sender].isfarmer && AuctionsMap[_auctionid].owner == msg.sender, "Caller is not the owner of Auction!");
        _;
    }




