    function startAuction(uint _startBlock,
        uint _endBlock, 
        string _name, 
        uint _reserve, 
        string _auctionid, 
        string _ipfsHash,  
        address _associatedBank,
        uint _totalValue) 
    external 
    onlyExistingUser
    onlyFarmer
    payable{

        require(_endBlock > _startBlock, "Endtime can not be less than start time!");

        require(_startBlock > block.number, "Start should be greater than current time!");

        require(!AuctionsMap[_auctionid].exists, "Auction already exists!");

        auctionObj = AuctionLib.Auction({
            name : _name,
            reserve : _reserve,
            startBlock : _startBlock,
            endBlock : _endBlock,
            owner : msg.sender,
            auctId : _auctionid,
            exists : true,
            totalBids : 0,
            bidders : new address[](0x0),
            ipfsHash : _ipfsHash,
            highestBid : 0,
            highestBidder : 0x0,
            associatedBank : _associatedBank,
            winner : 0x0,
            status : AuctionLib.Status.STARTED,
            totalValue : _totalValue * 10**18
        });

        AllAuctionIds.push(_auctionid);

        AuctionsMap[_auctionid] = auctionObj;

        FarmerAuctionsMap[msg.sender].push(_auctionid);

        users[msg.sender].auctionIds.push(_auctionid);

        uint statusInt = uint(AuctionsMap[_auctionid].status);

        emit LogAuctionAdd(_auctionid, msg.sender,statusInt);
    }

    function placeBid(string _auctionid) 
    external
    onlyAuctionExists(_auctionid)
    onlyStartedAuction(_auctionid)
    onlyNotCancelledAuction(_auctionid)    
    onlyAfterStartAuction(_auctionid)
    onlyBeforeEndAuction(_auctionid)
    shouldHaveValue
    payable{


        // Increase the bidding amount
        uint newBid = BidderFundsMap[_auctionid][msg.sender] + msg.value;

        // check if bid value is greater than the highest bid value
        require(newBid >= AuctionsMap[_auctionid].highestBid, "Bidding amount should be greater than the highest bid!");


        //update highest bid
        AuctionsMap[_auctionid].highestBid = newBid;

        //update highest bidder
        AuctionsMap[_auctionid].highestBidder = msg.sender;

        // Update the bidder fund
        BidderFundsMap[_auctionid][msg.sender] = newBid;

        // If he is new bidder
        if(!AuctionsMap[_auctionid].alreadyBidded[msg.sender]){
            // Push into bidder list
            AuctionsMap[_auctionid].bidders.push(msg.sender);   
        }

        // Total unique bidders
        AuctionsMap[_auctionid].totalBids = AuctionsMap[_auctionid].bidders.length;

        AuctionsMap[_auctionid].alreadyBidded[msg.sender] = true;

        emit LogBidPlace(_auctionid, msg.sender, msg.value);
    }

